import './App.css';
import Logo from './statics/LOGO.png';
import Header from './components/Header';

function App() {
  return (
    <main class="page">
      <div className="App">
        <Header></Header>
      </div>
      <img class="flag-logo" src={ Logo } alt="Logo"/>
    </main>
  );
}

export default App;
